(169, 'What assets are used to process the data for this activity?', 'Quels actifs sont utilisés pour traiter les données de cette activité?', '{\"dd\":{\"comment\":\"Select from existing assets below (List all assets present in asset inventory)\",\"data\":\"assets\"},\"qa\":{\"comment\":\"Add new assets below (New assets will be added in the Asset inventory)\"},\"sc\":[{\"data\":\"Not Sure\"},{\"data\":\"Not Applicable\"}]}', '{\"dd\":{\"comment\":\"Sélectionnez parmi les actifs existants ci-dessous (répertoriez tous les actifs présents dans l\'inventaire des actifs)\",\"data\":\"assets\"},\"qa\":{\"comment\":\"Ajoutez de nouveaux actifs ci-dessous (de nouveaux actifs seront ajoutés dans l\'inventaire des actifs)\"},\"sc\":[{\"data\":\"Pas certain\"},{\"data\":\"N\'est pas applicable\"}]}', '2.1', 'This includes assets involved in the collection, storage, analysis, sharing, etc. of the data.\r\nAn \'asset\' is something that supports information-related activities. Assets could include software systems, applications, databases, or even file cabinets\r\n', 'Cela comprend les actifs impliqués dans la collecte, le stockage, l\'analyse, le partage, etc. des données.\r\nUn «atout» est quelque chose qui soutient les activités liées à l\'information. Les actifs peuvent inclure des systèmes logiciels, des applications, des bases de données ou même des classeurs', 0, 0, 0, 'q-169', 'mc', 'Not Sure, Not Applicable', 'Pas sûr, sans objet', NULL, 19, 2, 9, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
