(210, 'What type of incident was this?', 'De quel type d\'incident s\'agissait-il?', NULL, NULL, '1.4', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-210', 'mc', 'Loss/Theft, Social Engineering (e.g. phishing), Unauthorized Disclosure of Information, Hoax, Intrusion, Denial of Service Attack (DoS), Virus/Malicious Code, System Misuse, Technical Vulnerability, Root Compromise, Website Defacement, User Account Compromise, Network Scanning/Probing, Misdirected Email, Not Sure, Not Applicable\r\n', 'Perte / vol, ingénierie sociale (par exemple, hameçonnage), divulgation non autorisée d\'informations, canular, intrusion, attaque par déni de service (DoS), virus / code malveillant, mauvaise utilisation du système, vulnérabilité technique, compromission de racine, défiguration de site Web, compromission de compte d\'utilisateur, réseau Numérisation / vérification, e-mail mal acheminé, incertain, non applicable', NULL, 26, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(211, 'What caused the incident? ', 'Qu\'est-ce qui a causé l\'incident?', NULL, NULL, '1.5', 'If the cause is unknown, please select \"not sure.\"\r\nSelect all that apply:\r\n', 'Si la cause est inconnue, veuillez sélectionner «pas sûr».\r\nSélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-211', 'mc', 'Human Error, Malicious Attack, Misuse, Not Sure, Not Applicable, Other', 'Erreur humaine, attaque malveillante, mauvaise utilisation, incertain, sans objet, autre', NULL, 26, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(212, 'What networks were involved in the incident?', 'Quels réseaux étaient impliqués dans l\'incident?', NULL, NULL, '2.1', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 0, 0, 0, 'q-212', 'mc', 'Internal Network, External Network, Not Sure, Not Applicable, Other', 'Réseau interne, réseau externe, incertain, non applicable, autre', NULL, 27, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(213, 'What assets were involved in the incident? ', 'Quels actifs étaient impliqués dans l\'incident?', NULL, NULL, '2.2', 'Please provide additional detail below.\r\nSelect all that apply:\r\n', 'Veuillez fournir des détails supplémentaires ci-dessous.\r\nSélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-213', 'mc', 'Desktop Computer, Laptop Computer, Server, Mobile Device, System Software, Application Software, File Cabinet, Not Sure, Not Applicable, Other', 'Ordinateur de bureau, ordinateur portable, serveur, appareil mobile, logiciel système, logiciel d\'application, classeur, incertain, sans objet, autre', NULL, 27, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(214, 'What clients/vendors were involved? ', 'Quels clients / fournisseurs étaient impliqués?', '{\"qa\":[{\"comment\":\"Organization Name\"},{\"comment\":\"Relationship (Client or Vendor)\"},{\"comment\":\"Primary Contact (if known)\"}],\"sc\":[{\"data\":\"Not Sure\"},{\"data\":\"Not Applicable\"}]}', '{\"qa\":[{\"comment\":\"nom de l\'organisation\"},{\"comment\":\"Relation (client ou fournisseur)\"},{\"comment\":\"Contact principal (si connu)\"}],\"sc\":[{\"data\":\"Pas certain\"},{\"data\":\"N\'est pas applicable\"}]}', '2.3', NULL, NULL, 0, 0, 0, 'q-214', 'cc', 'Organization name: Text field, Relationship (client or vendor): Text field, Primary contact (if known): Text field, Not Sure, Not Applicable\r\n', 'Nom de l\'organisation: Champ de texte, Relation (client ou fournisseur): Champ de texte, Contact principal (si connu): Champ de texte, Incertain, Sans objet\r\n', NULL, 27, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(215, 'What data was compromised?', 'Quelles données ont été compromises?', NULL, NULL, '2.4', 'Provide a list of the data elements compromised below:', 'Fournissez une liste des éléments de données compromis ci-dessous:', 0, 0, 0, 'q-215', 'qa', NULL, NULL, NULL, 27, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(216, 'What categories of individuals were affected by the incident?', 'Quelles catégories d\'individus ont été touchées par l\'incident?', NULL, NULL, '2.6', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 0, 0, 0, 'q-216', 'mc', 'Contractors, Customers, Employees, Patients, Prospective Employees, Students, Not Sure, Not Applicable, Other', 'Entrepreneurs, clients, employés, patients, employés potentiels, étudiants, incertain, sans objet, autre', NULL, 27, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(217, 'Approximately how many individuals were affected by the incident? ', 'Environ combien de personnes ont été touchées par l\'incident?', NULL, NULL, '2.7', 'If you know the exact number, please enter it in the Additional comments field.', 'Si vous connaissez le nombre exact, veuillez le saisir dans le champ Commentaires supplémentaires.', 1, 0, 0, 'q-217', 'sc', '1 - 10, 10 - 100, 100 - 1,000, 1,000 - 10,000, 10,000 - 100,000, 100,000 - 1 million, 1 million - 10 million, 10 million - 100 million, 100 million +, Not Sure, Not Applicable\r\n', '1 - 10, 10 - 100, 100 - 1 000, 1 000 - 10 000, 10 000 - 100 000, 100 000 - 1 million, 1 million - 10 millions, 10 millions - 100 millions, 100 millions et plus, Incertain, Sans objet', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00');
INSERT INTO `questions` (`id`, `question`, `question_fr`, `question_info`, `question_info_fr`, `question_num`, `question_comment`, `question_comment_fr`, `additional_comments`, `question_assoc_type`, `parent_question`, `form_key`, `type`, `options`, `options_fr`, `question_section`, `question_section_id`, `question_category`, `form_id`, `created_at`, `updated_at`) VALUES
(218, 'Approximately how many data records were compromised?', 'Environ combien d\'enregistrements de données ont été compromis?', '{\"qa\":{\"comment\":\"Number of records compromised\"},\"sc\":[{\"data\":\"Not Sure\"},{\"data\":\"Not Applicable\"}]}', '{\"qa\":{\"comment\":\"Nombre d\'enregistrements compromis\"},\"sc\":[{\"data\":\"\r\nPas certain\"},{\"data\":\"N\'est pas applicable\"}]}', NULL, NULL, NULL, 0, 0, 0, 'q-218', 'cc', 'Number of records compromiseddd: Text field, Not Sure, Not Applicable', 'Nombre d\'enregistrements compromis: champ de texte, pas sûr, non applicable', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(219, 'Is the incident likely to lead to any of the following? ', 'L\'incident est-il susceptible d\'entraîner l\'une des situations suivantes?', NULL, NULL, '2.9', 'Please do your best to answer. If you are unsure, please select \"not sure.\" \r\nSelect all that apply:\r\n', '\r\nVeuillez faire de votre mieux pour répondre. Si vous n\'êtes pas sûr, veuillez sélectionner «pas sûr».\r\nSélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-219', 'mc', 'Destruction of personal data, Alteration of personal data, Unauthorised disclosure of personal data, Unauthorised access to personal data, Not Sure, Not Applicable', 'Destruction des données personnelles, Modification des données personnelles, Divulgation non autorisée de données personnelles, Accès non autorisé aux données personnelles, Incertain, Sans objet', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(220, 'Was the data already publicly available? ', 'Les données étaient-elles déjà accessibles au public?', NULL, NULL, '3.1', NULL, NULL, 0, 0, 0, 'q-220', 'sc', 'Yes, No, Not Sure, Not Applicable', 'Oui, non, pas sûr, sans objet', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(221, 'Was the data encrypted? ', 'Les données ont-elles été cryptées?\r\n', NULL, NULL, '3.2', NULL, NULL, 0, 0, 0, 'q-221', 'sc', 'Yes, No, Not Sure, Not Applicable', 'Oui, non, pas sûr, sans objet', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(222, ' Who is the unauthorized person who used (or could use) the data, or to whom the disclosure was made?', 'Qui est la personne non autorisée qui a utilisé (ou pourrait utiliser) les données, ou à qui la divulgation a été faite?', NULL, NULL, '3.3', NULL, NULL, 1, 0, 0, 'q-222', 'sc', 'Trusted recipient, Trustworthy recipient, Untrusted recipient, Not Sure, Not Applicable', 'Destinataire de confiance, destinataire de confiance, destinataire non de confiance, pas sûr, sans objet', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(223, 'Do you know if the data was actually viewed or acquired? ', 'Savez-vous si les données ont été réellement consultées ou acquises?', NULL, NULL, '3.4', NULL, NULL, 1, 0, 0, 'q-223', 'sc', 'Not viewed or acquired, Viewed (or partially viewed) but not acquired, Acquired, Not Sure, Not Applicable', 'Non visualisé ou acquis, consulté (ou partiellement visualisé) mais non acquis, acquis, incertain, sans objet', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(224, 'To what extent has the risk to the data already been mitigated? ', 'Dans quelle mesure le risque pour les données a-t-il déjà été atténué?', NULL, NULL, '3.5', 'There is a good-faith reason to believe that the personal data have not and will not be used, disclosed or retained\r\nThere is a good-faith reason to believe that the personal data have not and will not be used or disclosed, but could be retained\r\n', 'Il y a une raison de bonne foi de croire que les données personnelles n\'ont pas et ne seront pas utilisées, divulguées ou conservées\r\nIl y a une raison de bonne foi de croire que les données personnelles n\'ont pas été et ne seront pas utilisées ou divulguées, mais pourraient être conservées', 1, 0, 0, 'q-224', 'sc', 'No mitigation, Not Sure, Not Applicable', 'Aucune atténuation, pas sûr, sans objet', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(225, 'Were any technical or organisational protection measures already implemented and applied to the data affected by the incident? ', 'Des mesures de protection techniques ou organisationnelles ont-elles déjà été mises en œuvre et appliquées aux données concernées par l\'incident?', NULL, NULL, '3.6', 'In particular, those that would render the personal data unintelligible to any person who is not authorised to access it, such as encryption. ', 'En particulier, celles qui rendraient les données personnelles inintelligibles pour toute personne qui n\'est pas autorisée à y accéder, comme le cryptage.', 1, 0, 0, 'q-225', 'sc', 'Yes, No, Not Sure, Not Applicable', 'Oui, non, pas sûr, sans objet', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(226, ' Have any subsequent measures been taken?', 'Des mesures ultérieures ont-elles été prises?', NULL, NULL, '3.7', 'Please list below and list the actions taken, when they were taken, and by whom:', 'Veuillez énumérer ci-dessous et énumérer les mesures prises, quand elles ont été prises et par qui:', 0, 0, 0, 'q-226', 'sc', 'Yes, No, Not Sure, Not Applicable', 'Oui, non, pas sûr, sans objet', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(227, 'What additional evidence was collected?', 'Quelles preuves supplémentaires ont été recueillies?\r\n', '{\"qa\":{\"comment\":\"Please provide a brief description of any additional evidence collected:\"},\"sc\":[{\"data\":\"Not Applicable\"}]}', '{\"qa\":{\"comment\":\"Veuillez fournir une brève description de toute preuve supplémentaire recueillie:\"},\"sc\":[{\"data\":\"N\'est pas applicable\"}]}', '3.8', '', NULL, 0, 0, 0, 'q-227', 'cc', 'Not Applicable, text field', 'Non applicable, champ de texte', NULL, 28, 2, 10, '2019-08-05 11:00:00', '2019-08-05 11:00:00'),
(228, 'Have you properly defined the scope of your privacy notice?', 'Avez-vous correctement défini la portée de votre politique de confidentialité?', NULL, NULL, '1.1', NULL, NULL, 1, 0, 0, 'q-228', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(229, 'Does your privacy notice clearly state the identity and contact details of the controller (and the controller\'s representative, where applicable)? ', 'Votre déclaration de confidentialité indique-t-elle clairement l\'identité et les coordonnées du responsable du traitement (et du représentant du responsable du traitement, le cas échéant)?', NULL, NULL, '1.2', NULL, NULL, 1, 0, 0, 'q-229', 'sc', 'Yes, No\r\n\r\n', 'Oui, Non', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(230, 'Does your privacy notice include the contact details of the GDPR owner or the data protection officer?', 'Votre déclaration de confidentialité comprend-elle les coordonnées du propriétaire du RGPD ou du délégué à la protection des données?', NULL, NULL, '1.3', NULL, NULL, 1, 0, 0, 'q-230', 'sc', 'Yes, No, Not Applicable', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(231, 'Does your privacy notice state why you are processing personal data (i.e. the purposes of processing), as well as the legal basis for such purposes? ', 'Votre déclaration de confidentialité indique-t-elle pourquoi vous traitez des données personnelles (c\'est-à-dire les finalités du traitement), ainsi que la base juridique de ces finalités?', NULL, NULL, '1.4', NULL, NULL, 1, 0, 0, 'q-231', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(232, 'For the processing activities which are based on the legitimate interest, does your privacy notice describe what those legitimate interests pursued by you (controller) or a third party are?', 'Pour les activités de traitement basées sur l\'intérêt légitime, votre déclaration de confidentialité décrit-elle quels sont ces intérêts légitimes poursuivis par vous (responsable du traitement) ou par un tiers?', NULL, NULL, '1.5', NULL, NULL, 1, 0, 0, 'q-232', 'sc', 'Yes, No, Not Applicable', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(233, 'Does your privacy notice specify the recipients or categories of recipients of the personal data? ', 'Votre politique de confidentialité spécifie-t-elle les destinataires ou les catégories de destinataires des données personnelles?', NULL, NULL, '1.6', NULL, NULL, 1, 0, 0, 'q-233', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(234, 'Do any of your processing activities involve transferring personal data to a third country outside the EEA or international organisation?', 'L\'une de vos activités de traitement implique-t-elle le transfert de données personnelles vers un pays tiers en dehors de l\'EEE ou d\'une organisation internationale?', NULL, NULL, '1.7', NULL, NULL, 1, 0, 0, 'q-234', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(235, 'Does your privacy notice state the period for which the personal data will be stored or, if not possible, the criteria used to determine that period? ', 'Votre déclaration de confidentialité indique-t-elle la période pendant laquelle les données personnelles seront stockées ou, si ce n\'est pas possible, les critères utilisés pour déterminer cette période?', NULL, NULL, '1.8', NULL, NULL, 1, 0, 0, 'q-235', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(236, 'Where you act as a controller, does your privacy notice state that individuals have the right to request the following from your organisation?', 'Lorsque vous agissez en tant que contrôleur, votre avis de confidentialité stipule-t-il que les individus ont le droit de demander ce qui suit à votre organisation?', NULL, NULL, '1.9', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-236', 'sc', 'Access to and rectification or erasure of personal data, Restriction of processing concerning him/her, Object to processing, Take the personal data you hold about him/her to another organisation (\'data portability\'), Not Applicable\r\n', 'Accès et rectification ou effacement des données personnelles, Restriction du traitement le concernant, Objection au traitement, Transférer les données personnelles que vous détenez à son sujet à une autre organisation (`` portabilité des données \'\'), Sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(237, 'Does your privacy notice specify that, for the processing activities based on the data subject\'s consent, the data subject has the right to withdraw consent at any time?', 'Votre déclaration de confidentialité précise-t-elle que, pour les activités de traitement basées sur le consentement de la personne concernée, la personne concernée a le droit de retirer son consentement à tout moment?', NULL, NULL, '1.10', 'This will not affect the lawfulness of the processing based on consent prior to the withdrawal of consent.If none of your processing activities are based on data subject\'s consent, click \'Not Applicable\'.', 'Cela n\'affectera pas la légalité du traitement basé sur le consentement avant le retrait du consentement.Si aucune de vos activités de traitement n\'est basée sur le consentement de la personne concernée, cliquez sur `` Sans objet \'\'.', 1, 0, 0, 'q-237', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(238, 'Does your privacy notice indicate that data subjects have the right to lodge a complaint with their supervisory authority?', 'Votre déclaration de confidentialité indique-t-elle que les personnes concernées ont le droit de déposer une plainte auprès de leur autorité de contrôle?', NULL, NULL, '1.11', NULL, NULL, 1, 0, 0, 'q-238', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(239, 'Does your privacy policy specify whether the collection of personal data is required by law?', 'Votre politique de confidentialité précise-t-elle si la collecte de données personnelles est requise par la loi?', NULL, NULL, '1.12', 'For example, the labour laws applying in your jurisdiction may require the collection of certain personal data for HR purposes. ', 'Par exemple, les lois du travail en vigueur dans votre juridiction peuvent exiger la collecte de certaines données personnelles à des fins RH.', 1, 0, 0, 'q-239', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(240, 'Does your privacy policy specify whether the collection of personal data is required by contract?', 'Votre politique de confidentialité précise-t-elle si la collecte de données personnelles est requise par contrat?', NULL, NULL, '1.13', 'For example, ride share apps need to process your location to provide the service.', 'Par exemple, les applications de covoiturage doivent traiter votre position pour fournir le service.', 0, 0, 0, 'q-240', 'sc', 'Yes, \r\nNo, \r\nNot Applicable\r\n', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(241, 'Does your privacy policy specify whether the collection of personal data is required to enter into a contract?', 'Votre politique de confidentialité précise-t-elle si la collecte de données personnelles est nécessaire pour conclure un contrat?', NULL, NULL, '1.14', 'For example, first name and surname to identify you as a party to a contract. ', 'Par exemple, le prénom et le nom pour vous identifier en tant que partie à un contrat.', 1, 0, 0, 'q-241', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(242, 'Does your privacy policy specify whether the data subject is obliged to provide the personal data and the possible consequences of not providing them', 'Votre politique de confidentialité précise-t-elle si la personne concernée est obligée de fournir les données personnelles et les conséquences possibles de ne pas les fournir', NULL, NULL, '1.15', 'For example, non-receipt of a benefit.', 'Par exemple, non-perception d\'une prestation.', 1, 0, 0, 'q-242', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(243, 'If your organisation performs automated decision-making (including profiling), does your privacy notice include information about the following:', 'Si votre organisation effectue une prise de décision automatisée (y compris le profilage), votre avis de confidentialité comprend-il des informations sur les éléments suivants:', NULL, NULL, '1.16', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-243', 'sc', 'The existence of such automated decision-making, Meaningful information about the logic involved, The significance of such processing for the data subject, The envisaged consequences of such processing for the data subject, Not Applicable', 'L\'existence d\'une telle prise de décision automatisée, Des informations significatives sur la logique impliquée, L\'importance d\'un tel traitement pour la personne concernée, Les conséquences envisagées d\'un tel traitement pour la personne concernée, Sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(244, 'If you, as a controller, intend to process personal data for a purpose other than for which the personal data were first collected, do you provide information to the data subject prior to starting that additional processing activity?', 'Si vous, en tant que responsable du traitement, avez l\'intention de traiter des données personnelles dans un but autre que celui pour lequel les données personnelles ont été collectées pour la première fois, fournissez-vous des informations à la personne concernée avant de commencer cette activité de traitement supplémentaire?', NULL, NULL, '1.17', 'This includes information on that other purpose and any relevant further information.', 'Cela comprend des informations sur cet autre objectif et toute autre information pertinente.', 1, 0, 0, 'q-244', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(245, 'Does your privacy notice specify the categories of personal data concerned? ', 'Votre déclaration de confidentialité précise-t-elle les catégories de données personnelles concernées?', NULL, NULL, '1.18', 'For example, employee data, customer data or special categories of data.', 'Par exemple, les données des employés, les données des clients ou des catégories spéciales de données.', 1, 0, 0, 'q-245', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(246, 'Does your privacy notice specify the source from which the personal data originates (and, if applicable, whether the data came from publicly accessible sources)? ', 'Votre déclaration de confidentialité précise-t-elle la source d\'où proviennent les données personnelles (et, le cas échéant, si les données proviennent de sources accessibles au public)?', NULL, NULL, '1.19', 'For example, a list purchased from a third party for your advertising activities or personal data found on the Internet. ', 'Par exemple, une liste achetée à un tiers pour vos activités publicitaires ou des données personnelles trouvées sur Internet.', 1, 0, 0, 'q-246', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 29, 2, 11, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
