(330, 'What data is involved in the activity', 'Quelles données sont impliquées dans l\'activité ?', NULL, NULL, '1.2', 'Please select the groups of data subjects you are processing data about for this activity, and for each group, select the categories of data and individual data elements processed.', 'Veuillez sélectionner les groupes de personnes concernées pour lesquels vous traitez des données pour cette activité, et pour chaque groupe, sélectionnez les catégories de données et les éléments de données individuels traités.', 0, 0, 0, 'q-330', '', NULL, NULL, NULL, 30, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
