(342, 'Employment Information', 'Information d\'emploi\r\n', NULL, NULL, '', '', NULL, 0, 0, 0, 'q-342', 'mc', 'Benefits and entitlements data, Business unit / division, Company / entity, Contract type - fixed term / temporary / permanent etc., Corporate Credit or Debit Card Numbers, Disciplinary action, End date & reason for termination, Exit interview and comments, Grievances and complaints, Health & safety related information and reporting, Hours of work, Job application details (e.g. application form,interview notes,references), Job title / role, Line / Reporting manager, Office location, Performance rating, Personnel number, Previous work history, Record of absence / time tracking / annual leave, Salary / wage, Salary / wage expectation, Start date, Workers Compensation Claims\r\n', 'Données sur les avantages et les droits, unité commerciale / division, société / entité, type de contrat - durée déterminée / temporaire / permanent etc., numéros de carte de crédit ou de débit d\'entreprise, action disciplinaire, date de fin et raison de la résiliation, entretien de sortie et commentaires, griefs et plaintes, informations et rapports liés à la santé et à la sécurité, heures de travail, détails de la demande d\'emploi (par exemple, formulaire de candidature, notes d\'entrevue, références), titre / rôle du poste, responsable hiérarchique / responsable des rapports, emplacement du bureau, évaluation des performances, numéro du personnel, antécédents professionnels , Registre des absences / suivi du temps / congé annuel, Salaire / salaire, Salaire / salaire anticipé, Date de début, Réclamations des accidents du travail', NULL, 30, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
