(350, 'Does the activity involve any of the following? ', 'L\'activité implique-t-elle l\'un des éléments suivants ?', NULL, NULL, '1.3', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 0, 0, 0, 'q-350', 'mc', 'Use of systematic and extensive profiling or automated decision-making to make significant decisions about people, Processing of special category data or criminal offence data on a large scale, Systematic monitoring of publicly accessible place on a large scale, Using new technologies, Using profiling, automated decision-making or special category data to help make decisions on someone’s access to a service, opportunity or benefit, Carrying out profiling on a large scale, Processing of biometric or genetic data, Combining, comparing or matching data from multiple sources, Processing of personal data without providing a privacy notice directly to the individual, Processing of personal data in a way which involves tracking individuals’ online or offline location or behaviour, Processing of children’s personal data for profiling or automated decision-making or for marketing purposes, or offering online services directly to them, Processing of personal data which could result in a risk of physical harm in the event of a security breach, Not Sure, Not Applicable\r\n', 'Utilisation du profilage systématique et extensif ou de la prise de décision automatisée pour prendre des décisions importantes sur les personnes, Traitement de données de catégorie spéciale ou de données sur les infractions pénales à grande échelle, Surveillance systématique des lieux accessibles au public à grande échelle, Utilisation de nouvelles technologies, Utilisation du profilage, prise de décision automatisée ou données de catégorie spéciale pour aider à prendre des décisions sur l\'accès d\'une personne à un service, une opportunité ou un avantage, Effectuer un profilage à grande échelle, Traitement de données biométriques ou génétiques, Combinaison, comparaison ou mise en correspondance de données provenant de sources multiples, Traitement de données personnelles sans fournir d\'avis de confidentialité directement à l\'individu, Traitement des données personnelles d\'une manière qui implique le suivi de l\'emplacement ou du comportement en ligne ou hors ligne des individus, Traitement des données personnelles des enfants à des fins de profilage ou de prise de décision automatisée ou à des fins de marketing, ou offre services en ligne directement à eux, Traitement des données personnelles pouvant entraîner un risque de dommage physique en cas de violation de la sécurité, pas sûr, sans objet', NULL, 30, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(351, 'Are any of the data already publicly available?', 'Certaines des données sont-elles déjà accessibles au public ?', NULL, NULL, '1.4', '', NULL, 1, 0, 0, 'q-351', 'sc', 'Yes, No, Not Sure\r\n', 'Oui, Non, Pas certain', NULL, 30, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(352, 'Did you select \'legitimate interests\' as your legal basis for processing? ', 'Avez-vous sélectionné les «intérêts légitimes» comme base juridique pour le traitement?', NULL, NULL, '1.5', '', NULL, 1, 0, 0, 'q-352', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 30, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(353, 'What steps have you taken to ensure that the data are processed in a transparent manner?', 'Quelles mesures avez-vous prises pour garantir que les données sont traitées de manière transparente?', NULL, NULL, '2.1', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-353', 'mc', 'Privacy Notices are presented to users, Users are made aware of who is collecting/using their data, Users are provided with the ability to report problems/concerns, A privacy dashboard is provided to users, Browser add-ons to assist with privacy are provided to users, Not Sure, Not Applicable, Other\r\n', 'Les avis de confidentialité sont présentés aux utilisateurs, les utilisateurs sont informés de qui collecte / utilise leurs données, les utilisateurs ont la possibilité de signaler les problèmes / préoccupations, un tableau de bord de confidentialité est fourni aux utilisateurs, des modules complémentaires de navigateur pour aider à la confidentialité sont fournis aux utilisateurs, pas sûr, sans objet, autre', NULL, 31, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(354, 'What steps have you taken to ensure that the data are collected and used only for specified, explicit and legitimate purposes? ', 'Quelles mesures avez-vous pris pour garantir que les données sont collectées et utilisées uniquement à des fins spécifiées, explicites et légitimes ?', NULL, NULL, '2.2', '\r\nSelect all that apply:\r\n', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-354', 'mc', 'The purpose of every data element is identified prior to collection, The specific purpose for every data element is documented, Data are never collected to have \"just in case\", Not Sure, Not Applicable, Other\r\n', 'Le but de chaque élément de données est identifié avant la collecte, Le but spécifique de chaque élément de données est documenté, Les données ne sont jamais collectées pour avoir \"juste au cas où\", Incertain, Sans objet, Autre', NULL, 31, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(355, 'What steps have you taken to ensure that data are not further processed in a manner that is incompatible with those purposes?', 'Quelles mesures avez-vous prises pour vous assurer que les données ne sont pas traitées ultérieurement d\'une manière incompatible avec ces finalités?', NULL, NULL, '2.3', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-355', 'mc', 'Processing utilisation and transfer rights are restricted, Company policies are in place to minimise our exposure to hackers, Quality assurance revisions are in place for compliance in software development, Separation exists between organisational and departmental boundaries, Role concepts with differentiated access rights on the basis of identity management and secure authentication methods are in place, Purpose specific pseudonyms  anonymisation services and/or anonymous credentials are used, Regulated procedures are in place for purpose amendments, Not Sure, Not Applicable, Other\r\n', 'L\'utilisation du traitement et les droits de transfert sont limités, des politiques de l\'entreprise sont en place pour minimiser notre exposition aux pirates informatiques, des révisions d\'assurance qualité sont en place pour la conformité dans le développement de logiciels, une séparation existe entre les limites organisationnelles et départementales, des concepts de rôle avec des droits d\'accès différenciés sur la base de la gestion de l\'identité et des méthodes d\'authentification sécurisées sont en place, des services d\'anonymisation de pseudonymes spécifiques à des fins spécifiques et / ou des informations d\'identification anonymes sont utilisés, des procédures réglementées sont en place pour les modifications de finalité, pas sûr, sans objet, autre', NULL, 31, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(356, 'For what additional purpose(s) is the data processed?', 'Dans quel (s) but (s) supplémentaire (s) les données sont-elles traitées ?', NULL, NULL, '2.4', 'If the data are not processed for any additional purposes, select \"Not Applicable.\"\r\nSelect all that apply:\r\n', 'Si les données ne sont pas traitées à des fins supplémentaires, sélectionnez «Sans objet».\r\nSélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-356', 'mc', 'Archiving purposes in the public interest, Scientific research, Historical research, Statistical purposes, Not Sure, Not Applicable, Other\r\n', 'Archivage à des fins d\'intérêt public, Recherche scientifique, Recherche historique, À des fins statistiques, Incertain, Sans objet, Autre', NULL, 31, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(357, 'What steps have you taken to ensure that the data are limited to what is necessary for the purpose of this activity?', 'Quelles mesures avez-vous pris pour vous assurer que les données sont limitées à ce qui est nécessaire aux fins de cette activité ?', NULL, NULL, '2.5', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-357', 'mc', 'Data is verified for adequacy in achieving its purpose, No more is collected/kept than is necessary to achieve a specific purpose, Data to be transferred is limited to that which is minimally necessary to achieve the purpose of the transfer, We have implemented automatic blocking and erasure routines,  The user-interface (UI) distinguishes between optional and required fields, Use of free-form text fields is avoided, Defined fields (e.g.,pre-populated lists/dropdowns,etc.) are used in favor of free-form text fields, Not Sure, Not Applicable, Other\r\n', 'Les données sont vérifiées pour leur adéquation à la réalisation de leur objectif, Il n\'est pas collecté / conservé plus que nécessaire pour atteindre un objectif spécifique, Les données à transférer sont limitées à ce qui est minimalement nécessaire pour atteindre l\'objectif du transfert, Nous avons mis en place un blocage automatique et les routines d\'effacement, L\'interface utilisateur (UI) fait la distinction entre les champs facultatifs et obligatoires, L\'utilisation de champs de texte de forme libre est évitée, Les champs définis (par exemple, listes / listes déroulantes pré-remplies, etc.) sont utilisés en faveur de champs de texte de formulaire, Incertain, Sans objet, Autre', NULL, 31, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(358, 'What steps have you taken to ensure that the data are accurate?', 'Quelles mesures avez-vous prises pour vous assurer que les données sont exactes?', NULL, NULL, '2.6', 'Select all that apply', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-358', 'mc', 'Controls are in place for periodically checking the accuracy and quality of data, Validation controls are in place to filter out inconsistent  incomplete and inaccurate data, Not Sure, Not Applicable, Other\r\n', 'Des contrôles sont en place pour vérifier périodiquement l\'exactitude et la qualité des données, Des contrôles de validation sont en place pour filtrer les données incomplètes et inexactes incohérentes, Incertain, Sans objet, Autre', NULL, 31, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(359, 'What steps have you taken to ensure that the data are kept up to date? ', 'Quelles mesures avez-vous prises pour vous assurer que les données sont tenues à jour?', NULL, NULL, '2.7', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-359', 'mc', 'Controls are in place to periodically check the accuracy and quality of data, Validation controls are in place to filter out old data, Old data are erased or updated, Not Sure, Not Applicable, Other\r\n', 'Des contrôles sont en place pour vérifier périodiquement l\'exactitude et la qualité des données, Des contrôles de validation sont en place pour filtrer les anciennes données, Les anciennes données sont effacées ou mises à jour, Incertain, Sans objet, Autre', NULL, 31, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(360, 'What steps have you taken to ensure that data are kept in a form that allows identification of individuals for no longer than is necessary for the purposes for which they are processed? ', 'Quelles mesures avez-vous prises pour garantir que les données sont conservées sous une forme permettant l\'identification des personnes pendant une durée n\'excédant pas la durée nécessaire aux fins pour lesquelles elles sont traitées?', NULL, NULL, '2.8', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-360', 'mc', 'Data inventory review and deletion processes are in place, Retention schedules and deletion triggers have been set, All personal information is erased upon a user\'s deactivation/deletion of their account,  Not Sure, Not Applicable, Other\r\n', 'Des processus d\'examen et de suppression de l\'inventaire des données sont en place, des calendriers de conservation et des déclencheurs de suppression ont été définis, Toutes les informations personnelles sont effacées lors de la désactivation / suppression de son compte par un utilisateur, Incertain, Sans objet, Autre', NULL, 31, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(361, 'Is a privacy notice provided to data subjects (individuals)?', 'Un avis de confidentialité est-il fourni aux personnes concernées (individus)?', NULL, NULL, '2.9', '', NULL, 1, 0, 0, 'q-361', 'sc', 'Yes, No, Not Sure, Not Applicable\r\n', 'Oui, non, pas sûr, sans objet', NULL, 31, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(362, ' Is a notice used to inform data subjects about how their data will be processed?', 'Un avis est-il utilisé pour informer les personnes concernées sur la manière dont leurs données seront traitées?', NULL, NULL, '3.1', '', NULL, 1, 0, 0, 'q-362', 'sc', 'Yes, No, Not Sure, Not Applicable\r\n\r\n', 'Oui, non, pas sûr, sans objet', NULL, 32, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(363, 'Is there a way for individuals to request access to their data?', 'Existe-t-il un moyen pour les particuliers de demander l’accès à leurs données ?', NULL, NULL, '3.2', '', NULL, 1, 0, 0, 'q-363', 'sc', 'Yes, No, Not Sure, Not Applicable\r\n\r\n\r\n\r\n', 'Oui, non, pas sûr, sans objet', NULL, 32, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(364, ' Is there a way for individuals to request a correction of inaccurate or incomplete data? ', 'Existe-t-il un moyen pour les particuliers de demander une correction de données inexactes ou incomplètes?', NULL, NULL, '3.3', '', NULL, 1, 0, 0, 'q-364', 'sc', 'Yes, No, Not Sure, Not Applicable\r\n\r\n\r\n\r\n', 'Oui, non, pas sûr, sans objet', NULL, 32, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(365, 'Is there a way to find and delete personal data, upon request?', 'Existe-t-il un moyen de rechercher et de supprimer des données personnelles, sur demande ?', NULL, NULL, '3.4', '', NULL, 1, 0, 0, 'q-365', 'sc', 'Yes, No, Not Sure, Not Applicable\r\n\r\n\r\n\r\n', 'Oui, non, pas sûr, sans objet', NULL, 32, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(366, 'Is there a way to restrict the processing of an individual\'s data, upon request? ', 'Existe-t-il un moyen de restreindre le traitement des données d\'un individu, sur demande ?', NULL, NULL, '3.5', '', NULL, 1, 0, 0, 'q-366', 'sc', 'Yes, No, Not Sure, Not Applicable\r\n\r\n\r\n\r\n', 'Oui, non, pas sûr, sans objet', NULL, 32, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(367, ' Is there a way to transfer personal data to the individual, or to another party, in a structured, commonly used and machine readable format?', 'Existe-t-il un moyen de transférer des données personnelles à l\'individu, ou à une autre partie, dans un format structuré, couramment utilisé et lisible par machine?', NULL, NULL, '3.6', '', NULL, 1, 0, 0, 'q-367', 'sc', 'Yes, No, Not Sure, Not Applicable\r\n\r\n\r\n\r\n', 'Oui, non, pas sûr, sans objet', NULL, 32, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(368, 'Is there a way for individuals to object to the processing of their data? ', 'Existe-t-il un moyen pour les particuliers de s\'opposer au traitement de leurs données?', NULL, NULL, '3.7', '', NULL, 1, 0, 0, 'q-368', 'sc', 'Yes, No, Not Sure, Not Applicable\r\n\r\n\r\n\r\n', 'Oui, non, pas sûr, sans objet', NULL, 32, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(369, ' Is there a way for individuals to request that they not be subject to a decision made about them based on automated profiling?', 'Existe-t-il un moyen pour les individus de demander qu\'ils ne soient pas soumis à une décision prise à leur sujet sur la base d\'un profilage automatisé?', NULL, NULL, '3.8', 'This does not include processing that has little or no effect on individuals.', 'Cela n\'inclut pas le traitement qui a peu ou pas d\'effet sur les individus.', 1, 0, 0, 'q-369', 'sc', 'Yes, No, Not Sure, Not Applicable\r\n\r\n\r\n\r\n\r\n', 'Oui, non, pas sûr, sans objet', NULL, 32, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(370, 'What assets are used to collect store and process the data', 'Quels actifs sont utilisés pour collecter, stocker et traiter les données', '{\"dd\":{\"comment\":\"Select from existing assets below (List all assets present in asset inventory)\",\"data\":\"assets\"},\"qa\":{\"comment\":\"Add new assets below (New assets will be added in the Asset inventory)\"},\"sc\":[{\"data\":\"Not Sure\"},{\"data\":\"Not Applicable\"}]}', '{\"dd\":{\"comment\":\"Sélectionnez parmi les actifs existants ci-dessous (répertoriez tous les actifs présents dans l\'inventaire des actifs)\",\"data\":\"assets\"},\"qa\":{\"comment\":\"Ajoutez de nouveaux actifs ci-dessous (de nouveaux actifs seront ajoutés dans l\'inventaire des actifs)\"},\"sc\":[{\"data\":\"Pas certain\"},{\"data\":\"N\'est pas applicable\"}]}', '4.1', 'What do you use to collect, store and process the data?\r\nAn \'asset\' is something that supports information-related activities. Assets could include software systems, applications, databases, or even file cabinets.\r\n', 'Qu\'utilisez-vous pour collecter, stocker et traiter les données?\r\nUn «atout» est quelque chose qui soutient les activités liées à l\'information. Les actifs peuvent inclure des systèmes logiciels, des applications, des bases de données ou même des classeurs.', 0, 0, 0, 'q-370', 'mc', 'Select from existing assets below: (List all asset present in the Asset inventory)Item Selection, Add new assets below: (New assets will be added in the Asset inventory)Text field, Not Sure, Not Applicable\r\n', 'Sélectionnez parmi les actifs existants ci-dessous: (Liste de tous les actifs présents dans l\'inventaire d\'actifs) Sélection d\'articles, Ajouter de nouveaux actifs ci-dessous: (De nouveaux actifs seront ajoutés dans l\'inventaire d\'actifs) Champ de texte, Incertain, Sans objet', NULL, 33, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(371, 'Have you considered the following when choosing your security measures? ', 'Avez-vous pris en compte les éléments suivants lors du choix de vos mesures de sécurité ?', NULL, NULL, '4.2', 'Select all that apply:', 'Sélectionnez tout ce qui s\'y rapporte:', 1, 0, 0, 'q-371', 'mc', 'The state of the art, The costs of implementation, The nature of processing, The scope of processing, The context of processing, The purposes of processing, The risk of varying likelihood and severity for the rights and freedoms of natural persons, Not Sure\r\n', 'L\'état de l\'art, Les coûts de mise en œuvre, La nature du traitement, L\'étendue du traitement, Le contexte du traitement, Les finalités du traitement, Le risque de probabilité et de gravité variables pour les droits et libertés des personnes physiques, Incertain', NULL, 33, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(372, ' Does your organisation adheres to any approved codes of conduct? ', 'Votre organisation adhère-t-elle à des co ...', NULL, NULL, '4.3', '', NULL, 1, 0, 0, 'q-372', 'sc', 'Yes, No, Not Sure, Not Applicable', 'Oui, non, pas sûr, sans objet', NULL, 33, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(373, ' Please provide any additional information here. ', 'Veuillez fournir des informations supplémentaires ici.', NULL, NULL, '5.1', '', NULL, 0, 0, 0, 'q-373', 'qa', '', NULL, NULL, 34, 2, 12, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(374, 'Does your organisation process personal data ? ', 'Votre organisation traite-t-elle les données personnelles ?', NULL, NULL, '1.1', NULL, NULL, 0, 0, 0, 'q-374', 'sc', 'Yes, No, Not Sure\r\n', 'Oui, non, pas sûr', NULL, 35, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(375, 'Is your organisation located in the European Union? ', 'Votre organisation est-elle située dans l\'Union européenne ?', NULL, NULL, '1.2', NULL, NULL, 0, 0, 0, 'q-375', 'sc', 'Yes, No\r\n', 'Oui, non', NULL, 35, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(376, 'Is your organisation located outside the EU AND does it offer goods or services to individuals residing in the EU?', 'Votre organisation est-elle située en dehors de l\'UE ET propose-t-elle des biens ou des services aux personnes résidant dans l\'UE?', NULL, NULL, '1.3', NULL, NULL, 0, 0, 0, 'q-376', 'sc', 'Yes, No\r\n', 'Oui, non', NULL, 35, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(377, 'Is your organisation located outside the EU AND does it monitor the behaviour of EU residents (for behaviour taking place in the EU)? ', 'Votre organisation est-elle située en dehors de l\'UE ET surveille-t-elle le comportement des résidents de l\'UE (pour les comportements qui ont lieu dans l\'UE)?', NULL, NULL, '1.4', NULL, NULL, 0, 0, 0, 'q-377', 'sc', 'Yes, No\r\n', 'Oui, non', NULL, 35, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(378, 'Is your organisation located outside the EU, but has an establishment in the EU with some processing activity related to that EU establishment?', 'Votre organisation est-elle située en dehors de l\'UE, mais possède un établissement dans l\'UE avec une activité de traitement liée à cet établissement de l\'UE?', NULL, NULL, '1.5', NULL, NULL, 0, 0, 0, 'q-378', 'sc', 'Yes, No\r\n', 'Oui, non', NULL, 35, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(379, 'Does your organisation have fewer than 250 employees? ', 'Votre organisation compte-t-elle moins de 250 employés?', NULL, NULL, '2.1', NULL, NULL, 0, 0, 0, 'q-379', 'sc', 'Yes, No\r\n', 'Oui, non', NULL, 36, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(380, 'Have you made a list of all of your organisation\'s processing activities?', 'Avez-vous dressé une liste de toutes les activités de traitement de votre organisation?', NULL, NULL, '2.2', NULL, NULL, 0, 0, 0, 'q-380', 'sc', 'Yes, No\r\n', 'Oui, non', NULL, 36, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(381, 'Have you identified for each processing activity the activities where your organisation acts as a controller and those for which it acts as a processor?', 'Avez-vous identifié pour chaque activité de traitement les activités dans lesquelles votre organisation agit en tant que responsable du traitement et celles pour lesquelles elle agit en tant que sous-traitant?', NULL, NULL, '2.3', NULL, NULL, 0, 0, 0, 'q-381', 'sc', 'Yes, No\r\n', 'Oui, non', NULL, 36, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00');
INSERT INTO `questions` (`id`, `question`, `question_fr`, `question_info`, `question_info_fr`, `question_num`, `question_comment`, `question_comment_fr`, `additional_comments`, `question_assoc_type`, `parent_question`, `form_key`, `type`, `options`, `options_fr`, `question_section`, `question_section_id`, `question_category`, `form_id`, `created_at`, `updated_at`) VALUES
(382, 'For the record of processing activity where you act as a controller, does your record include ALL of the following:', 'Pour l\'enregistrement de l\'activité de traitement où vous agissez en tant que responsable du traitement, votre dossier comprend-il TOUS les éléments suivants:', NULL, NULL, '2.4', '<ul style=\"margin-left:15px\"><li>	The name and contact details of your organisation, \r\n</li><li>	The purposes of the processing, \r\n</li><li>	A description of the categories of data subjects and of the categories of personal data \r\n</li><li>	The categories of recipients to whom the personal data have been or will be disclosed, \r\n</li><li>	Any transfer of personal data to a third country of international organisation, \r\n</li><li>	The time limits for erasure for the different categories of data, and\r\n</li><li>	A general description of the technical and organisational security measures?\r\n</li></ul>', '<ul style=\"margin-left:15px\"><li>	Le nom et les coordonnées de votre organisation, \r\n</li><li>	Les finalités du traitement, \r\n</li><li>	Une description des catégories de personnes concernées et des catégories de données personnelles \r\n</li><li>	Les catégories de destinataires auxquels les données personnelles ont été ou seront divulguées, \r\n</li><li>	Tout transfert de données personnelles vers un pays tiers d\'une organisation internationale, \r\n</li><li>	Les délais d\'effacement pour les différentes catégories de données, et\r\n</li><li>	Une description générale des mesures de sécurité techniques et organisationnelles?\r\n</li></ul>', 1, 0, 0, 'q-382', 'sc', 'Yes, No, Not Sure\r\n', 'Oui, non, pas sûr', NULL, 36, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(383, 'For the record of processing activity where you act as a processor, does your record of categories of processing activities include all of the following:', 'Pour l\'enregistrement des activités de traitement où vous agissez en tant que sous-traitant, votre enregistrement des catégories d\'activités de traitement comprend-il tous les éléments suivants:', NULL, NULL, '2.5', '<ul style=\"margin-left:15px\"><li>	The name and contact details of your organisation (processor)</li>\r\n<li>	The categories of processing carried out on behalf of each controller</li>\r\n<li>	Any transfer of personal data to a third country or international organisation (if applicable, and identify the country if a country outside the EEA), and, \r\n</li><li>	Where possible a general description of the technical and organisational security measures?</li></ul>', '<ul style=\"margin-left:15px\"><li>	Le nom et les coordonnées de votre organisation (sous-traitant)</li>\r\n<li>	Les catégories de traitements effectués pour le compte de chaque responsable du traitement</li>\r\n<li>	Tout transfert de données personnelles vers un pays tiers ou une organisation internationale (le cas échéant, et identifier le pays s\'il s\'agit d\'un pays en dehors de l\'EEE), et, \r\n</li><li>	Dans la mesure du possible, une description générale des mesures de sécurité techniques et organisationnelles?</li></ul>', 1, 0, 0, 'q-383', 'sc', '\r\nYes, No, Not Sure, Not Applicable\r\n\r\n', 'Oui, non, pas sûr, sans objet', NULL, 36, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(384, 'Are the records of processing activities or categories of processing activities in writing (including in electronic form)?', 'Les enregistrements des activités de traitement ou des catégories d\'activités de traitement sont-ils écrits (y compris sous forme électronique)?', NULL, NULL, '2.6', NULL, NULL, 1, 0, 0, 'q-384', 'sc', 'Yes, No, Not Sure\r\n', 'Oui, non, pas sûr', NULL, 36, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(402, 'Do you collect personal data only for specified, explicit and legitimate purposes?', 'Collectez-vous des données personnelles uniquement à des fins déterminées, explicites et légitimes?', NULL, NULL, '3.1', NULL, NULL, 0, 0, 0, 'q-402', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 37, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(403, 'Do you have secondary uses for personal data that you have collected?', 'Avez-vous des utilisations secondaires des données personnelles que vous avez collectées?', NULL, NULL, '3.2', NULL, NULL, 0, 0, 0, 'q-403', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 37, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(404, 'Do you only collect the personal data that are adequate and relevant for the purposes for which they are processed?', 'Ne collectez-vous que les données personnelles qui sont adéquates et pertinentes aux fins pour lesquelles elles sont traitées?', NULL, NULL, '3.3', NULL, NULL, 0, 0, 0, 'q-404', 'sc', 'Yes, No, Not Sure\r\n', 'Oui, non, pas sûr', NULL, 37, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(405, 'Do you collect personal data that is accurate, and where necessary, keep it up to date so that all personal data you process are accurate?', 'Collectez-vous des données personnelles exactes et, le cas échéant, les maintenez-vous à jour afin que toutes les données personnelles que vous traitez soient exactes?', NULL, NULL, '3.4', NULL, NULL, 0, 0, 0, 'q-405', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 37, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(406, 'Do you keep personal data only for the duration necessary for the purpose for which you are processing it', 'Conservez-vous les données personnelles uniquement pendant la durée nécessaire à la finalité pour laquelle vous les traitez\r\n', NULL, NULL, '3.5', NULL, NULL, 0, 0, 0, 'q-406', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 37, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(407, 'Have you identified which legal basis you rely on for each one of your processing activities?', 'Avez-vous identifié sur quelle base juridique vous vous appuyez pour chacune de vos activités de traitement?', NULL, NULL, '3.6', NULL, NULL, 0, 0, 0, 'q-407', 'sc', 'Yes, No, Not Sure\r\n', 'Oui, non, pas sûr', NULL, 37, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(408, 'Do you process any of the following type of personal data?', 'Traitez-vous l\'un des types de données personnelles suivants?', NULL, NULL, '4.1', 'Personal data revealing:\r\n<ul style=\"margin-left:15px\"><li>	Racial or ethnic origin\r\n</li><li>	Political opinions\r\n</li><li>	Religious or philosophical beliefs\r\n</li><li>	Trade union membership\r\n</li><li>	Genetic data\r\n</li><li>	Biometric data for authentication (uniquely identifying a person)\r\n</li><li>	Data concerning health\r\n</li><li>	Data concerning someone\'s sex life or sexual orientation </li></ul>\r\n', 'Données personnelles révélant:\r\n<ul style=\"margin-left:15px\"><li>	Origine raciale ou ethnique\r\n</li><li>	Opinions politiques\r\n</li><li>	Croyances religieuses ou philosophiques\r\n</li><li>	Appartenance syndicale\r\n</li><li>	Données génétiques\r\n</li><li>	Données biométriques pour l\'authentification (identification unique d\'une personne)\r\n</li><li>	Données relatives à la santé\r\n</li><li>	Données concernant la vie sexuelle ou l\'orientation sexuelle d\'une personne </li></ul>', 0, 0, 0, 'q-408', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 38, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(409, 'Do you process personal data about children below 16 in the context of the offering of information society services? ', 'Traitez-vous des données personnelles concernant des enfants de moins de 16 ans dans le cadre de l\'offre de services de la société de l\'information?', NULL, NULL, '4.2', 'Examples of information society services are:\r\n<ul style=\"margin-left:15px\"><li>	Mobile Apps</li>\r\n<li>Streaming services</li>\r\n<li>	Chat or other communication networks</li></ul>\r\n', 'Des exemples de services de la société de l\'information sont:\r\n<ul style=\"margin-left:15px\"><li>	Application mobile</li>\r\n<li>Services de streaming</li>\r\n<li>	Chat ou autres réseaux de communication</li></ul>', 0, 0, 0, 'q-409', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 38, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(410, 'Do any of the following apply to you?', 'L\'une des situations suivantes s\'applique-t-elle à vous?', NULL, NULL, '5.1', '<ul style=\"margin-left:15px\"><li>You are a public authority or body (and NOT a court acting in its judicial capacity)\r\n</li><li>	Your core activities consist of processing operations which, by virtue of their nature, their scope and/or their purposes, require regular and systematic monitoring of data subjects on a large scale;\r\n</li><li>	Your core activities consist of processing on a large scale of special categories of data or personal data relating to criminal convictions and offences</li></ul>\r\n', '<ul style=\"margin-left:15px\"><li>Vous êtes une autorité ou un organisme public (et NON un tribunal agissant en sa capacité judiciaire)\r\n</li><li>	Vos activités principales consistent en des traitements qui, de par leur nature, leur étendue et / ou leurs finalités, nécessitent un suivi régulier et systématique des personnes concernées à grande échelle;\r\n</li><li>	Vos activités principales consistent à traiter à grande échelle des catégories spéciales de données ou de données personnelles relatives à des condamnations pénales et des infractions.</li></ul>', 0, 0, 0, 'q-410', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 39, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(411, 'If you have designated a DPO, does he/she have sufficient professional qualities, knowledge of data protection law and practices and the ability to fulfil his/her tasks? ', 'Si vous avez désigné un DPD, a-t-il / elle des qualités professionnelles suffisantes, une connaissance du droit et des pratiques en matière de protection des données et la capacité d\'accomplir ses tâches?', NULL, NULL, '5.2', NULL, NULL, 0, 0, 0, 'q-411', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 39, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(412, 'If you have a DPO, have you published his/her contact details? ', 'Si vous avez un DPD, avez-vous publié ses coordonnées?', NULL, NULL, '5.3', NULL, NULL, 0, 0, 0, 'q-412', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 39, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(413, 'If you have a DPO, have you communicated his/her contact details to the appropriate supervisory authority? ', 'Si vous avez un DPD, avez-vous communiqué ses coordonnées à l\'autorité de contrôle compétente?', NULL, NULL, '5.4', NULL, NULL, 0, 0, 0, 'q-413', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 39, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(414, ' If you have a DPO, is the DPO properly and in a timely manner involved in all issues related to the protection of personal data? ', 'Si vous avez un DPO, le DPO est-il correctement et en temps opportun impliqué dans toutes les questions liées à la protection des données personnelles?', NULL, NULL, '5.5', NULL, NULL, 0, 0, 0, 'q-414', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 39, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(415, 'If you have a DPO, is the DPO provided with sufficient resources to carry out his/her tasks and maintain his/her expert knowledge? ', 'Si vous avez un DPO, le DPO dispose-t-il de ressources suffisantes pour mener à bien ses tâches et maintenir ses connaissances d\'expert?', NULL, NULL, '5.6', NULL, NULL, 0, 0, 0, 'q-415', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 39, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(416, 'If you have a DPO, is he/she acting independently? ', 'Si vous avez un DPO, agit-il de manière indépendante?', NULL, NULL, '5.7', NULL, NULL, 0, 0, 0, 'q-416', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 39, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(417, 'If you have a DPO, is the DPO bound by secrecy or confidentiality with respect to his/her performance of his/her tasks?', 'Si vous avez un DPO, le DPO est-il tenu au secret ou à la confidentialité en ce qui concerne l\'accomplissement de ses tâches?', NULL, NULL, '5.8', NULL, NULL, 0, 0, 0, 'q-417', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 39, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(418, 'Do you have internal processes in place to ensure that proper safeguards are integrated into the different processing activities? ', 'Avez-vous mis en place des processus internes pour vous assurer que des garanties appropriées sont intégrées dans les différentes activités de traitement?', NULL, NULL, '6.1', NULL, NULL, 0, 0, 0, 'q-418', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 40, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(419, 'Do you conduct a data protection impact assessment prior to starting any processing activity that is likely to result in a high risk for individuals?', 'Effectuez-vous une analyse d\'impact sur la protection des données avant de commencer toute activité de traitement susceptible d\'entraîner un risque élevé pour les personnes?', NULL, NULL, '7.1', NULL, NULL, 0, 0, 0, 'q-419', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 41, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(420, 'If you have a DPO, is the DPO involved in the review of DPIAs? ', 'Si vous avez un DPO, le DPO est-il impliqué dans l\'examen des DPIAs?', NULL, NULL, '7.2', NULL, NULL, 0, 0, 0, 'q-420', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet', NULL, 41, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(421, 'Does your DPIA contain at least all of the following: ', 'Votre DPIA contient-il au moins tous les éléments suivants:', NULL, NULL, '7.3', '<ul style=\"margin-left:15px\"><li>a description of the processing activities and the purposes of the processing, including, where applicable, the legitimate interest pursued by the controller</li><li>an assessment of the necessity and proportionality of the processing operations in relation to the purposes;</li><li>an assessment of the risks to the rights and freedoms of data subjects; and</li><li>the measures considered to address the risks, to ensure the protection of personal data and to demonstrate compliance with the GDPR</li></ul>\r\n', '<ul style=\"margin-left:15px\"><li>une description des activités de traitement et des finalités du traitement, y compris, le cas échéant, l\'intérêt légitime poursuivi par le responsable du traitement</li><li>une évaluation de la nécessité et de la proportionnalité des traitements par rapport aux finalités;</li><li>une évaluation des risques pour les droits et libertés des personnes concernées; et</li><li>les mesures envisagées pour faire face aux risques, assurer la protection des données personnelles et démontrer la conformité au RGPD</li></ul>\r\n', 0, 0, 0, 'q-421', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 41, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(422, 'Do you have a process in place to ensure the DPIA is reviewed when there is a change of the risk represented by the processing activity? ', 'Avez-vous mis en place un processus pour vous assurer que DPIA est examinée en cas de changement du risque représenté par l\'activité de traitement?', NULL, NULL, '7.4', 'For example, the number of individuals concerned increases significantly.', 'Par exemple, le nombre d\'individus concernés augmente considérablement.', 0, 0, 0, 'q-422', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 41, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(423, 'Has your organization implemented technical and organisational measures that ensure the level of security is appropriate to the risk?', 'Votre organisation a-t-elle mis en œuvre des mesures techniques et organisationnelles garantissant que le niveau de sécurité est adapté au risque?', NULL, NULL, '8.1', NULL, NULL, 0, 0, 0, 'q-423', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 42, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(424, 'Do you have a valid GDPR privacy notice easily accessible to individuals:', 'Avez-vous un avis de confidentialité GDPR valide facilement accessible aux particuliers:', NULL, NULL, '9.1', NULL, NULL, 0, 0, 0, 'q-424', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 43, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(425, 'Does your organisation enable individuals to exercise the rights they have under GDPR by informing individuals about those rights?', 'Votre organisation permet-elle aux individus d\'exercer les droits dont ils disposent en vertu du GDPR en informant les individus de ces droits?', NULL, NULL, '9.2', NULL, NULL, 0, 0, 0, 'q-425', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 43, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(426, 'Do you have an internal policy in place describing how data subject requests are being handled within your organisation?', 'Disposez-vous d\'une politique interne décrivant la manière dont les demandes des personnes concernées sont traitées au sein de votre organisation?', NULL, NULL, '9.3', NULL, NULL, 0, 0, 0, 'q-426', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 43, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(427, 'Do you have proper training in place for the employees that may receive data subject requests and those who will be in charge of handling them? ', 'Disposez-vous d\'une formation adéquate pour les employés susceptibles de recevoir des demandes de personnes concernées et ceux qui seront en charge de les traiter?', NULL, NULL, '9.4', NULL, NULL, 0, 0, 0, 'q-427', 'sc', 'Yes, No, Not Sure\r\n', 'Oui, non, pas sûr\r\n', NULL, 43, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(428, 'Are you aware of or did you verify the possible derogations that may exist in the jurisdiction in which you are located? ', 'Connaissez-vous ou avez-vous vérifié les dérogations possibles qui peuvent exister dans la juridiction dans laquelle vous vous trouvez?', NULL, NULL, '9.5', NULL, NULL, 0, 0, 0, 'q-428', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 43, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(429, 'Prior to engaging a new vendor, do you conduct a vendor assessment to identify whether or not the vendor has appropriate technical and organisational measures to protect the personal data?', 'Avant d\'engager un nouveau fournisseur, effectuez-vous une évaluation du fournisseur pour déterminer si le fournisseur dispose ou non de mesures techniques et organisationnelles appropriées pour protéger les données personnelles?', NULL, NULL, '10.1', NULL, NULL, 0, 0, 0, 'q-429', 'mc', 'Yes, No\r\n', 'Oui, Non', NULL, 44, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(430, 'Do you have a Data Protection Agreement in place with your vendor ?', 'Avez-vous un accord de protection des données en place avec votre fournisseur?', NULL, NULL, '10.2', NULL, NULL, 0, 0, 0, 'q-430', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 44, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(431, 'Do any of your processing activities involve the transfer of personal data outside the EEA or to an international organisation?', 'L\'une de vos activités de traitement implique-t-elle le transfert de données personnelles en dehors de l\'EEE ou vers une organisation internationale?', NULL, NULL, '11.1', NULL, NULL, 0, 0, 0, 'q-431', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 45, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(432, 'Do you have a proper mechanism you rely on for each transfer outside the EEA or to an international organisation? ', 'Disposez-vous d\'un mécanisme approprié sur lequel vous comptez pour chaque transfert en dehors de l\'EEE ou vers une organisation internationale?\r\n', NULL, NULL, '11.2', 'For example: the EU-US Privacy Shield Framework or binding corporate rules', 'Par exemple: le cadre du bouclier de protection des données UE-États-Unis ou des règles d\'entreprise contraignantes', 0, 0, 0, 'q-432', 'sc', 'Yes, No, Not Applicable\r\n', 'Oui, non, sans objet\r\n', NULL, 45, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(433, 'Do you have proper mechanism in place to identify a security incident and have the DPO (or GDPR owner) made aware of such incident?', 'Avez-vous mis en place un mécanisme approprié pour identifier un incident de sécurité et informer le DPO (ou le propriétaire du RGPD) d\'un tel incident?', NULL, NULL, '12.1', NULL, NULL, 0, 0, 0, 'q-433', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 46, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(434, 'When the organisation becomes aware of a security incident, is the DPO (or other person) involved to determine whether the incident constitutes a personal data breach under the GDPR?', 'Lorsque l\'organisation prend connaissance d\'un incident de sécurité, le DPO (ou une autre personne) est-il impliqué pour déterminer si l\'incident constitue une violation de données personnelles au sens du GDRP?', NULL, NULL, '12.2', NULL, NULL, 0, 0, 0, 'q-434', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 46, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(435, 'When the organization becomes aware of a security incident, is the DPO (or other person) involved to determine if the organization is acting as a controller or processor in the context of that personal data breach? ', 'Lorsque l\'organisation prend connaissance d\'un incident de sécurité, le DPD (ou une autre personne) est-il impliqué pour déterminer si l\'organisation agit en tant que contrôleur ou sous-traitant dans le contexte de cette violation de données personnelles?', NULL, NULL, '12.3', NULL, NULL, 0, 0, 0, 'q-435', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 46, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(436, 'Do you have a personal data breach plan in place? ', 'Avez-vous mis en place un plan de violation de données personnelles?', NULL, NULL, '12.4', NULL, NULL, 0, 0, 0, 'q-436', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 46, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(437, 'Where a notification to the supervisory authority is necessary, do you have proper processes in place? ', 'Lorsqu\'une notification à l\'autorité de contrôle est nécessaire, avez-vous mis en place des processus appropriés?', NULL, NULL, '12.5', NULL, NULL, 0, 0, 0, 'q-437', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 46, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(438, 'Where a notification to data subjects is necessary, do you have proper processes in place?', 'Lorsqu\'une notification aux personnes concernées est nécessaire, avez-vous mis en place des processus appropriés?', NULL, NULL, '12.6', NULL, NULL, 0, 0, 0, 'q-438', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 46, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
(439, 'Do you have processes in place to ensure that proper documentation regarding the personal data breach is kept? ', 'Avez-vous mis en place des processus pour vous assurer que la documentation appropriée concernant la violation de données personnelles est conservée?\r\n', NULL, NULL, '12.7', NULL, NULL, 0, 0, 0, 'q-439', 'sc', 'Yes, No\r\n', 'Oui, Non', NULL, 46, 2, 13, '2019-08-06 11:00:00', '2019-08-06 11:00:00'),
